            "En 1930, al pastor protestante Anthony Campion, que acaba de llegar con su mujer a Australia, le confían una delicada misión: convencer al pintor Norman Lindsay para que retire de una exposición internacional una de las telas calificada de escandalosa por la Iglesia. Debido a estas circunstancias, la pareja acaba pasando varios días en casa del pintor y allí, en una libertina atmósfera, su unión empieza a desestabilizarse.Una de las películas que contribuyó a establecer a Hugh Grant como una estrella fue esta comedia del australiano John Duigan ('Un hombre de éxito') que reflexionaba sobre el papel del arte en la sociedad y sobre la represión sexual inherente a la mayoría de las religiones occidentales. La película significó también el debut cinematográfico de la top model Elle McPherson, que lució en ella una esplendorosa desnudez, además de una prometedora capacidad interpretativa.",
          lang: null,
          category: 'Películas de comedia',
